/// BitLocker: BitLocker Drive Encryption performance counters
///
/// This performance counter does not have non-instance based counters
module ``BitLocker`` =

  [<Literal>]
  let CategoryName = "BitLocker"

  let PerfCat = Category.create CategoryName

  /// Returns an array of the instances available on this node/machine.
  let instances () =
    PerfCat
    |> Option.fold (fun s pcc -> Category.instances pcc) Array.empty
    |> Array.filter (fun inst -> not (Array.contains inst KnownInstances.All))

  /// Max Read Split Size: Maximum read buffer split size in bytes during last interval
  let ``Max Read Split Size`` instances =
    WinPerfCounter.create(CategoryName, "Max Read Split Size", instances)
  /// Max Write Split Size: Maximum write buffer split size in bytes during last interval
  let ``Max Write Split Size`` instances =
    WinPerfCounter.create(CategoryName, "Max Write Split Size", instances)
  /// Min Read Split Size: Minimum read buffer split size in bytes during last interval
  let ``Min Read Split Size`` instances =
    WinPerfCounter.create(CategoryName, "Min Read Split Size", instances)
  /// Min Write Split Size: Minimum write buffer split size in bytes during last interval
  let ``Min Write Split Size`` instances =
    WinPerfCounter.create(CategoryName, "Min Write Split Size", instances)
  /// Read Requests/sec: Number of read requests received over the last second
  let ``Read Requests/sec`` instances =
    WinPerfCounter.create(CategoryName, "Read Requests/sec", instances)
  /// Read Subrequests/sec: Number of read subrequests issued over the last second
  let ``Read Subrequests/sec`` instances =
    WinPerfCounter.create(CategoryName, "Read Subrequests/sec", instances)
  /// Write Requests/sec: Number of write requests received over the last second
  let ``Write Requests/sec`` instances =
    WinPerfCounter.create(CategoryName, "Write Requests/sec", instances)
  /// Write Subrequests/sec: Number of write subrequests issued over the last second
  let ``Write Subrequests/sec`` instances =
    WinPerfCounter.create(CategoryName, "Write Subrequests/sec", instances)

  let allCounters instances =
    [| ``Max Read Split Size`` instances
       ``Max Write Split Size`` instances
       ``Min Read Split Size`` instances
       ``Min Write Split Size`` instances
       ``Read Requests/sec`` instances
       ``Read Subrequests/sec`` instances
       ``Write Requests/sec`` instances
       ``Write Subrequests/sec`` instances
    |]

