/// Hyper-V VM Vid Numa Node: The perf counters for a numa node.
///
/// This performance counter does not have non-instance based counters
module ``Hyper-V VM Vid Numa Node`` =

  [<Literal>]
  let CategoryName = "Hyper-V VM Vid Numa Node"

  let PerfCat = Category.create CategoryName

  /// Returns an array of the instances available on this node/machine.
  let instances () =
    PerfCat
    |> Option.fold (fun s pcc -> Category.instances pcc) Array.empty
    |> Array.filter (fun inst -> not (Array.contains inst KnownInstances.All))

  /// PageCount: The number of physical pages detected on this NUMA node.
  let ``PageCount`` instances =
    WinPerfCounter.create(CategoryName, "PageCount", instances)
  /// ProcessorCount: The number of logical processors detected on this NUMA node.
  let ``ProcessorCount`` instances =
