  /// Disk Write Bytes/sec: Disk Write Bytes/sec is rate at which bytes are transferred to the disk during write operations.
  let ``Disk Write Bytes/sec`` instances =
    WinPerfCounter.create(CategoryName, "Disk Write Bytes/sec", instances)
  /// Disk Writes/sec: Disk Writes/sec is the rate of write operations on the disk.
  let ``Disk Writes/sec`` instances =
    WinPerfCounter.create(CategoryName, "Disk Writes/sec", instances)
  /// Split IO/Sec: Split IO/Sec reports the rate at which I/Os to the disk were split into multiple I/Os. A split I/O may result from requesting data of a size that is too large to fit into a single I/O or that the disk is fragmented.
  let ``Split IO/Sec`` instances =
    WinPerfCounter.create(CategoryName, "Split IO/Sec", instances)

  let allCounters instances =
    [| ``% Disk Read Time`` instances
       ``% Disk Time`` instances
       ``% Disk Write Time`` instances
       ``% Idle Time`` instances
       ``Avg. Disk Bytes/Read`` instances
       ``Avg. Disk Bytes/Transfer`` instances
       ``Avg. Disk Bytes/Write`` instances
       ``Avg. Disk Queue Length`` instances
       ``Avg. Disk Read Queue Length`` instances
       ``Avg. Disk Write Queue Length`` instances
       ``Avg. Disk sec/Read`` instances
       ``Avg. Disk sec/Transfer`` instances
       ``Avg. Disk sec/Write`` instances
       ``Current Disk Queue Length`` instances
       ``Disk Bytes/sec`` instances
       ``Disk Read Bytes/sec`` instances
       ``Disk Reads/sec`` instances
       ``Disk Transfers/sec`` instances
       ``Disk Write Bytes/sec`` instances
       ``Disk Writes/sec`` instances
       ``Split IO/Sec`` instances
    |]

