       ``Bytes Transmitted/Sec``
       ``CRC Errors``
       ``Frames Received``
       ``Frames Received/Sec``
       ``Frames Transmitted``
       ``Frames Transmitted/Sec``
       ``Percent Compression In``
       ``Percent Compression Out``
       ``Serial Overrun Errors``
       ``Timeout Errors``
